#hicelebexclusiveinterview In an exclusive interview with Hi Celeb Magazine, Miss Planet International 2024 ( @missglobalpeace ) opens up about her journey beyond the crown. With elegance, purpose, and an unwavering commitment to making a difference, she shares her thoughts on empowerment, global unity, and staying grounded in the spotlight.

Now joining the Road to Miss Universe UAE, she is aiming to represent her country on the global stage at Miss Universe this year, bringing with her not only beauty and intelligence, but a deep sense of national pride and a powerful voice for change.

From her fashion must-haves to her heartfelt advocacy work, she reminds us that true beauty lies in compassion and confidence. Join us as we dive into the inspiring world of a queen who’s using her voice for change—gracefully, powerfully, and authentically.

Don’t miss this special conversation with a woman of substance and style.

